summary.label:
This is a teleconsultation app for patient, employee or a doctor to solve health related questions on-the-go. You can:
- chat or have an on-demand video call with a doctor every day until late hours,
- have a prescription or referral from the doctor; 
- do prescription renewals with few taps, 
- make appointments with secondary care doctors,
- have a free consultation with pharmacist. 
****
Käesolev äpp on mõeldud patsiendile, töötajale ning arstile tervisealase kaugnõustamise läbiviimiseks. Saate:
- pidada nõu arsti ja apteekriga nii video kui chati teel iga päev hiliste õhtutundideni;
- saada retsepti või saatekirja;
- pikendada retsepte mõne nupuvajutusega;
- broneerida aegu eriarsti vastuvõtule.
